import styled from "styled-components";
import { motion } from "framer-motion";



export const Main = styled.div`
margin:0;
padding:80px 170px 0 170px;
box-size:border-box;
background:white;
height:900px;
width:100%;
position:relative;
font-family: 'Arvo', serif;
@media screen and (max-width: 768px) {
  height:100%;
  max-width:100%;
  padding:30px;
    }
  }
`;
